import React from 'react'
import {Col, Row} from 'antd'
import {ShortCard} from '../../../Components/Cards'
import {RecordsCardWrapper} from '../atoms'

export const RecordsCard = ({orgName, meetTime, src, specName, specCat}) => {
    return (
        <RecordsCardWrapper>
            <Row>
                <Col span={24} className='org-name'>{orgName}</Col>
                <Col span={24} className='meet-time'>{meetTime}</Col>
                <Col span={24}>
                    <ShortCard
                        imgSize={40}
                        imgUrl={src}
                        name={specName}
                        text={specCat}
                    />
                </Col>
            </Row>
        </RecordsCardWrapper>
    )
}
